        const response = gameserver.get('/leaderboard/Test/Nithin2')
        console.log(response)

    }

    async loadLeaderboard(){
        const response =  await gameserver.get('/leaderboard/Test/Nithin2')
        console.log(response.data)
    }

    render(){
        return(
            <div>
                <h1>Leaderboard : {this.state.leaderboardName}</h1>
                <h1 onMouseMove={loadLeaderboard}>LeaderboardEntries</h1> :
